CollectionMonster_Xls =
{
    ["1"]={monsterId=1,monsterNameDes="蚁源",monsterShow=0,monsterShape=1,monsterIcon="",monsterLock="",monsterDanger="",monsterNo="",story1Name="描述",story1Text="极其罕见的特殊异生体，有且仅有核心作为主体，核心呈黑色半透明规则几何体结构，表面有紫色纹路，通过半透明表面可以观察到核心内部与其属性相对应的符文，外围有与属性相应的光环，强度与核心的面数呈正相关，即正4、8、12、20面体、星光四面体（24面），分别对应威胁等级1-5，曾出现过违反欧拉定律，理论上不可能存在的正32面体结构，但该异生体仅短暂存在了【数据删除】就因结构崩溃而死亡。\n\n      值得一提的是，根据与AE-14遭遇过的斯露德提交的报告看来，无论斯露德与AE-14处于何种位置关系，看到的永远是这枚符文与光环的“正面”，甚至如果两位斯露德从不同角度观察，看到的也都是正面，造成这种现象的原因未知。\n",story1Lock=1,story2Name="攻击方式",story2Text="\n各种对应属性射线、弹幕、AOE\n",story2Lock=1,story3Name="附录1",story3Text="“无论从哪个角度，都只能看到它的‘正面’？这份报告是谁提交的？也许我应该给她……”\n\n“你刚才说什么？”\n\n“等等，什么？博士你……”\n\n“我在问，你，刚才，说了什么？！”\n\n“这……这份报告是谁提交的……”\n\n“再上一句。”\n\n“无论从哪个角度，都只能看到符文的‘正面’？”\n\n“‘正面’……报告呢？给我看看。”\n\n“可是…..博士，你相信这种莫名其妙的报告？这只是因为旋转与角度问题产生的错觉，世界上怎么可能存在从任何角度都只能观察到一个面的……”\n\n“它当然存在。”\n\n“它？博士，你……”\n\n“它当然存在，而且你每天都能看到它，不是吗？”\n\n“您是指——”\n\n[b]录音结束。[/b] \n",story3Lock=1,story4Name="附录2",story4Text="I.S.1952.4.21\n\n      她的话提醒了我……理想球体某种意义上是否也可以视作一个由无限多的点、线、面构成的正多面体？\n\n      如果是的话，似乎一切就都可以解释了，就像第八长子（注释：指TEO-08）不能容忍任何其他蛇形异生体的存在一样，没有任何生命能容忍一个“伪物”出现在自己面前。\n\n      毋庸置疑，突破了“V-E+F=2”这一桎梏的它已经有了被视为“伪物”的资格……不，不对，也许“V-E+F=2”本身就是一道筛除“伪物”的机制，祂寻求的是新的可能性，而不是另一个自己，所以有别于理想球体的星光四面体这种模式才能被容许存在……\n\n\n[b]“真理”，真是可笑——（字迹逐渐扭曲，后续无法辨认）\n[血迹]\n[血迹]\n[血迹]\n[/b]",story4Lock=1},
